import React from 'react'
import { Link } from '@material-ui/core';
const resultSanitized = require('../resultSanitized/resultSanitized')


const dataTable =
    [
        ["1", "anuncio1", "R$36,738", "130m2", "R$3309.00", "Centro", <Link target="_blank" rel="noopener" href="http://www.google.com.br">Link do Anúncio</Link>],
    ]

const dataTeste = resultSanitized.map((ap, index) => {
    return [
        `${index}`,
        `${ap.nome}`,
        `${ap.preco}`,
        `${ap.areaUtil}`,
        "R$3309.00",
        `${ap.bairro}`,
        <Link target="_blank" rel="noopener" href="`${ap.link}`"> Link do Anúncio</Link >
    ]
})
console.log(dataTeste)

export default dataTable;
